const TabItem = ({menuItem, menuImage, ChooseCrypto}) => {
    
    
 return(<div onClick={(e) => ChooseCrypto(menuItem, menuImage)} >
 {menuItem}
 {test}


</div>

 ); 
};

export default TabItem;
